pragma solidity ^0.4.11;

import 'zeppelin-solidity/contracts/token/StandardToken.sol';
import 'zeppelin-solidity/contracts/lifecycle/Pausable.sol';
import './KnowYourCustomer.sol';
import './AntiMoneyLaundering.sol';

/**
 * @title Regulatory token
 *
 * @dev StandardToken modified with pausable transfers.
 **/

contract RegulatoryToken is StandardToken, KnowYourCustomer, AntiMoneyLaundering, Pausable {

  function transfer(address _to, uint256 _value) public
		complyAMLonEmission(msg.sender, _value) complyAMLonReception(_to, _value)
		whenKYCisValid(_to) whenKYCisValid(msg.sender)
		whenNotPaused returns (bool) {
    return super.transfer(_to, _value);
  }

  function transferFrom(address _from, address _to, uint256 _value) public
		complyAMLonEmission(_from, _value) complyAMLonReception(_to, _value)
		whenKYCisValid(_from) whenKYCisValid(_to) whenKYCisValid(msg.sender)
		whenNotPaused returns (bool) {
    return super.transferFrom(_from, _to, _value);
  }

  function approve(address _spender, uint256 _value) public
		complyAMLonEmission(msg.sender, _value) complyAMLonReception(_spender, _value)
		whenKYCisValid(_spender) whenKYCisValid(msg.sender)
		whenNotPaused returns (bool) {
    return super.approve(_spender, _value);
  }

  function increaseApproval(address _spender, uint _addedValue) public
		complyAMLonEmission(msg.sender, _addedValue) complyAMLonReception(_spender, _addedValue)
		whenKYCisValid(_spender) whenKYCisValid(msg.sender)
		whenNotPaused returns (bool success) {
    return super.increaseApproval(_spender, _addedValue);
  }

  function decreaseApproval(address _spender, uint _subtractedValue) public
		complyAMLonEmission(_spender, _subtractedValue) complyAMLonReception(_spender, _subtractedValue)
		whenKYCisValid(_spender) whenKYCisValid(msg.sender)
		whenNotPaused returns (bool success) {
    return super.decreaseApproval(_spender, _subtractedValue);
  }
}
